<p>–ú–µ–Ω—ñ –∂, –±—É–ª–æ –Ω—ñ–∫–æ–ª–∏ –∑–≤–æ–ª—ñ–∫–∞—Ç–∏, —Ç–æ–∂ –ø–æ–∫–∏ –Ω–µ —Å—Ç–µ–º–Ω—ñ–ª–æ, —è –≤–∏—Ä—ñ—à–∏–≤ –π—Ç–∏ –∑–∞ –ø—Ä–æ–¥—É–∫—Ç–∞–º–∏. –°–ø—É—Å—Ç–∏–≤—à–∏—Å—å –ø–æ –ø—ñ—à–æ—Ö—ñ–¥–Ω–æ–º—É –º–æ—Å—Ç—É, —è –≤–∏–π—à–æ–≤ –≤ –º—ñ—Å—Ç–æ. –¶—å–æ–≥–æ —Ä–∞–∑—É, —è –≤–∂–µ –∑–Ω–∞–≤, —â–æ –º–∞–≥–∞–∑–∏–Ω –∑–Ω–∞—Ö–æ–¥–∏—Ç—å—Å—è –ø—Ä–∞–∫—Ç–∏—á–Ω–æ –ø—ñ–¥ –Ω–æ—Å–æ–º, —Ç–æ–∂, –Ω–µ –ø–æ—Å–ø—ñ—à–∞—é—á–∏, –ø–æ–∫—Ä–æ–∫—É–≤–∞–≤ –¥–æ –Ω—å–æ–≥–æ. –û—á–µ–≤–∏–¥–Ω–æ, –º—ñ—Å—Ü–µ–≤–∏–π —É–Ω—ñ–≤–µ—Ä–º–∞–≥ –ø–æ–ø—É–ª—è—Ä–Ω–∏–π —è–∫ —Å–µ—Ä–µ–¥ —Ç—É—Ä–∏—Å—Ç—ñ–≤, –¥–ª—è —è–∫–∏—Ö –ì—Ä–µ–±—ñ–Ω–∫–∞ —î —Ç—Ä–∞–Ω–∑–∏—Ç–Ω–æ—é —Å—Ç–∞–Ω—Ü—ñ—î—é, —Ç–∞–∫ —ñ —Å–µ—Ä–µ–¥ –º—ñ—Å—Ü–µ–≤–æ—ó –º–æ–ª–æ–¥—ñ.</p>
<p>–í–∏–±–∏—Ä–∞–≤ –ø—Ä–æ–¥—É–∫—Ç–∏ —è —Ç–∞–∫–æ–∂ –Ω–µ –ø–æ—Å–ø—ñ—à–∞—é—á–∏, –∞–¥–∂–µ –Ω–∞ –≤–æ–∫–∑–∞–ª —Ö–æ—Ç—ñ–≤ –ø–æ–≤–µ—Ä–Ω—É—Ç–∏—Å—å –∫–æ–ª–∏ –≤–∂–µ –ø–æ–≤–Ω—ñ—Å—Ç—é —Å—Ç–µ–º–Ω—ñ—î.</p><strong><a id='b4'></a><h2>–ü—Ä–∏–ª—É–∫–∏ | –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ üíó | –ß–µ—Ä–Ω—ñ–≥—ñ–≤—Å—å–∫–∞ –æ–±–ª–∞—Å—Ç—å ‚Äî mistaUA</h2></strong><p>–ì—É–ª—è—Ç–∏ –ì—Ä–µ–±—ñ–Ω–∫–æ—é —Ü—å–æ–≥–æ —Ä–∞–∑—É –≤ –º–µ–Ω–µ —á–æ–º—É—Å—å –±–∞–∂–∞–Ω–Ω—è –Ω–µ –≤–∏–Ω–∏–∫–Ω—É–ª–æ, —Ç–æ–∂ –≤–∏–∫—É—Ä–∏–≤—à–∏ —Ü–∏–≥–∞—Ä–∫—É —Ç–∞ –ø–æ—Å–∏–¥—ñ–≤—à–∏ –Ω–∞ –ª–∞–≤–æ—á—Ü—ñ –±—ñ–ª—è —É–Ω—ñ–≤–µ—Ä–º–∞–≥—É, —è –∑–Ω–æ–≤—É –ø—ñ—à–æ–≤ –Ω–∞ –≤–æ–∫–∑–∞–ª. –í —Å—É—Ç—ñ–Ω–∫–∞—Ö —Å—Ç–∞–Ω—Ü—ñ—è –ì—Ä–µ–±—ñ–Ω–∫–∞ –≤–∏–≥–ª—è–¥–∞—î –¥—É–∂–µ –∑–∞–≤–æ—Ä–æ–∂–ª–∏–≤–æ. –í–∏–¥ –∑ –ø—ñ—à–æ—Ö—ñ–¥–Ω–æ–≥–æ –±—É–≤ –ø—Ä–æ—Å—Ç–æ –ø—Ä–∏–≥–æ–ª–æ–º—à–ª–∏–≤–∏–π, —Ç–æ–∂ –ø—Ä–∏–±–ª–∏–∑–Ω–æ –∑-–ø—ñ–≤-–≥–æ–¥–∏–Ω–∏ —è –Ω–∞—Å–æ–ª–æ–¥–∂—É–≤–∞–≤—Å—è –Ω–∞–≤–∫–æ–ª–∏—à–Ω—å–æ—é –∫—Ä–∞—Å–æ—é —Ç–∞ –∞—Ç–º–æ—Å—Ñ–µ—Ä–æ—é —Å—Ç–∞–Ω—Ü—ñ—ó, —è–∫–∞ —Ç–æ–Ω—É–ª–∞ –≤ —Å—É—Ç—ñ–Ω–∫–∞—Ö.</p>
<p>–ß–∞—Å –ø—Ä–æ—Ö–æ–¥–∏–≤ –Ω–µ –¥—É–∂–µ —à–≤–∏–¥–∫–æ. –á—Å—Ç–∏, —Å–ª—É—Ö–∞—Ç–∏ –º—É–∑–∏–∫—É, –∫—É—Ä–∏—Ç–∏ - —Ç–∞–∫–∏–º–∏ –±—É–ª–∏ –æ—Å–Ω–æ–≤–Ω—ñ –º–æ—ó —Ä–æ–∑–≤–∞–≥–∏, –∫–æ–ª–∏ —è —á–µ–∫–∞–≤ –Ω–∞ –¥–∏–∑–µ–ª—å. –ß–∏–º –º–µ–Ω–µ –ø–æ—Ä–∞–¥—É–≤–∞–ª–∞ –ì—Ä–µ–±—ñ–Ω–∫–∞, —Ç–∞–∫ —Ü–µ —Ç–∞–∫–æ—é-—Å–æ–±—ñ –ª–∞–≤–æ—á–∫–æ—é –¥–ª—è —ñ–Ω—Ç—Ä–æ–≤–Ω—Ä—Ç—ñ–≤, —è–∫–∞ –∑–Ω–∞—Ö–æ–¥–∏–ª–∞—Å—å —É —Å–∞–º–æ–º—É –∫—ñ–Ω—Ü—ñ –ø–µ—Ä–æ–Ω—É. –¢—É—Ç –º–æ–∂–Ω–∞ –±—É–ª–æ —Å–ø–æ–∫—ñ–π–Ω–æ –≤—ñ–¥–ø–æ—á–∏–≤–∞—Ç–∏ —ñ –Ω–µ –ø–µ—Ä–µ–∂–∏–≤–∞—Ç–∏ —á–µ—Ä–µ–∑ —Ç–µ, —â–æ —Ö—Ç–æ—Å—å –º–æ–∂–µ —Ç–µ–±–µ –ø–æ—Ç—É—Ä—É–±—É–≤–∞—Ç–∏. –ë–ª–∏–∂—á–µ –¥–æ –æ–ø—ñ–≤–Ω–æ—á—ñ, –Ω–∞ –≤—É–ª–∏—Ü—ñ —Å—Ç–∞–ª–æ –≤—ñ–¥—á—É—Ç–Ω–æ –ø—Ä–æ—Ö–æ–ª–æ–¥–Ω—ñ—à–µ, —Ç–æ–∂ —Ä–µ—à—Ç—É —á–∞—Å—É —è –ø—Ä–æ–≤—ñ–≤ –≤—Å–µ—Ä–µ–¥–∏–Ω—ñ –∑–∞–ª–∏ –æ—á—ñ–∫—É–≤–∞–Ω–Ω—è, —è–∫–∏—Ö —É –ì—Ä–µ–±—ñ–Ω—Ü—ñ, –¥–æ —Ä–µ—á—ñ, –¥–≤–∞.</p>
<p>–û —Ä–æ–∑–ø–æ—á–∞–ª–∞—Å—å –ø–æ—Å–∞–¥–∫–∞ –Ω–∞ –¥–∏–∑–µ–ª—å-–ø–æ—ó–∑–¥ "–ì—Ä–µ–±—ñ–Ω–∫–∞ - –ù—ñ–∂–∏–Ω". –Ø –≤–∂–µ —ó—Ö–∞–≤ –Ω–∏–º –ø—ñ–¥ —á–∞—Å –ø–µ—Ä—à–æ—ó –ø–æ–¥–æ—Ä–æ–∂—ñ. –¢–æ–¥—ñ —è —ó—Ö–∞–≤ –¥–æ —Å–∞–º–æ—ó –∫—ñ–Ω—Ü–µ–æ—ó —Å—Ç–∞–Ω—Ü—ñ—ó, —Ü—å–æ–≥–æ –∂ —Ä–∞–∑—É –≤–∏—Ö–æ–¥–∏–≤ —É –ü—Ä–∏–ª—É–∫–∞—Ö, –ø—Ä–∏–±–ª–∏–∑–Ω–æ –Ω–∞ –ø–æ–ª–æ–≤–∏–Ω—ñ —à–ª—è—Ö—É –¥–æ –∫—ñ–Ω—Ü–µ–≤–æ—ó —Å—Ç–∞–Ω—Ü—ñ—ó. –°–ø–∞—Ç–∏ –±—É–ª–æ –Ω—ñ–∫–æ–ª–∏, –±–æ –¥–æ –ü—Ä–∏–ª—É–∫ –¥–æ—Ä–æ–≥–∞ –∑–∞–π–º–∞–ª–∞ –º–µ–Ω—à–µ –Ω—ñ–∂ –¥–≤—ñ –≥–æ–¥–∏–Ω–∏.</p>
</p>
